import React from "react";
import { View, StyleSheet } from "react-native";
import LocationName from "./LocationName";
import Distance from "./Distance";
import InfoButton from "./InfoButton";

const ResultListContainer = ({ restaurantList }) => {
  return (
    <View>
      {restaurantList.map((i) => {
        return (
          <View>
            <LocationName key={i} locationName={restaurantList[i].restaurantName} />
            <Distance key={i} distance={restaurantList[i].distance} />
            <InfoButton />
          </View>
        );
      })
      }
      {/* <View style={styles.listContainer}>
        <LocationName locationName={restaurantList[1].restaurantName} />
        <Distance distance={restaurantList[1].distance} />
        <InfoButton />
      </View> */}
    </View>
  );
};

